  KEY `fkAlunos_hasDisciplinasProfessores1_idx` (`idProfessor`),
  CONSTRAINT `fkAlunos_hasDisciplinasAlunos1` FOREIGN KEY (`idAluno`) REFERENCES `alunos` (`idAluno`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fkAlunos_hasDisciplinasDisciplinas1` FOREIGN KEY (`idDisciplina`) REFERENCES `disciplinas` (`idDisciplina`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fkAlunos_hasDisciplinasProfessores1` FOREIGN KEY (`idProfessor`) REFERENCES `professores` (`idProfessor`) ON DELETE NO ACTION ON UPDATE NO ACTION
